.monthMaecenas--quote {
    background: var(--accent-dark);
}

.monthMaecenas--quote:before {
    border-bottom: 10px solid var(--accent-dark);
}

.MarketSearchBar--InventoryGameSelect.chosen-container.highlighted {
    box-shadow: 0 0 3px 1px rgba(130, 88, 248, .9);
}

/* Chat */
#ChatboxStartIcon {
    background: var(--accent-dark2);
}

#ChatboxStartIcon:before {
    color: var(--accent);
}

#completeChatbox.chatboxWidget .header {
    background-image: linear-gradient(45deg, rgb(130, 88, 248), rgb(130, 88, 248));
}

.chatboxWidget .chatboxWrapper {
    border: 0px solid var(--accent-dark);
}

#chatbox {
    background: var(--accent-dark2);
}

#completeChatbox.chatboxWidget .controls.reversedDirection {
    border-top: 1px solid var(--accent-dark);
}

.ChatboxInput {
    background-color: var(--accent-dark2) !important;
}

#completeChatbox .controls.reversedDirection {
    background: var(--accent-dark2);
    border-top: 1px solid var(--accent-dark);
}

#completeChatbox.chatboxWidget .header > .element.closeChatboxButton {
    padding: 0px 8px;
    margin: 0 -8px;
    font-size: 14px;
    color: var(--accent-whiter);
    text-shadow: 0px 0px 0px rgb(54, 54, 54), 1px 1px 1px var(--accent-dark2);
    cursor: pointer;
}


/******************** Forums ********************/
.titleBar h1,
#pageDescription {}

.PageNav a.currentPage {
    background: var(--accent);
}

.PageNav a.currentPage:hover {
    background: var(--accent-light) !important;
}

.stickyThreads {
    border-left: 2px solid var(--accent);
}

/******************** Threads ********************/
.thread_view .titleBar,
.messageList .message,
.simpleRedactor.QuickReplyRedactor {
    background: var(--accent-dark2);
}

.nodeList .node.current > .nodeInfo > .nodeText > .nodeTitle,
.nodeList .node .current > div > .nodeTitle {
    color: rgb(130, 88, 248);
}

#pageDescription > a,
#pageDescription > a > abbr {
    color: var(--accent);
}

.forumSearchThreadsMenu {
    background: var(--accent-dark2);
}

.forumSearchThreads--Link--Icon {
    background: var(--accent);
}

.forumSearchThreads--Link:hover .forumSearchThreads--Link--Icon {
    background: var(--accent-light);
}

.forumSearchThreadsMenu .discussionListItem.current {
    background: var(--accent-dark);
}

.message .messageSimple .comment {
    background: var(--accent-dark2);
}

.messageSimple .comment .commentContent .author {
    color: white;
    background: var(--accent);
}

.alertNotice {
    background: var(--accent-dark2);
}

.CommentLoader {
    color: var(--accent);
}

html .redactor_toolbar li a:hover {
    background: var(--accent-dark);
}

.needInNewArticles {
    filter: hue-rotate(var(--accent-hue));
}

/******************** Articles ********************/
#articlesGrid,
.articleImageBox {
    background: var(--accent-dark2);
}

#articleTitleBlock {
    background: var(--accent-dark);
}

.TagContainer {
    border: 0;
    padding: 5px;
    margin: 0;
    background: var(--accent-dark2);
}

.tagList .tag {
    background: var(--accent);
}

.marketUpgradeBadge::before {
    content: '';
    background-size: 100%;
    width: 100px;
    height: 30px;
    float: left;
    filter: hue-rotate(103deg);
}

#lzt-market-logo {
    background-size: 100%;
    width: 135px;
    height: 44px;
    float: left;
    margin: 0 10px 0 0;
    filter: grayscale(1);
}

/******************** Market ********************/
.backToHomeButton {
    background: var(--accent-dark);
}

.backToHomeButton:hover {
    background: var(--accent-dark2);
}

.marketSidebarMenu {
    background: var(--accent-dark2);
}

.marketSidebarMenu .svgIcon svg {
    filter: hue-rotate(var(--accent-hue2));
}

.chosen-container .chosen-results li.active-result,
.marketSidebarMenu a:hover {
    background: var(--accent-dark);
}

.marketSidebarMenu .balanceNumber,
.marketMyPayments > .item .amountChange .in {
    color: var(--accent);
}

.marketMyPayments > .item .comment {
    background: var(--accent-dark);
}

.marketMyPayments > .item .comment .commentSvg {
    fill: var(--accent-dark);
}

.searchBarForm--searchHistory,
.categoryLinks .link {
    color: white;
    background: var(--accent-dark2);
}

.searchBarForm--searchHistory:hover,
.categoryLinks .link:hover {
    background: var(--accent-light);
    color: white;
}

.qiwiForm {
    background: rgb(39, 39, 39);
    margin: 0 auto;
    width: 350px;
    padding: 30px 40px;
    border-top: 5px solid rgb(130, 88, 248);
    border-radius: 6px;
}

.extendedGuarantee {
    color: var(--accent);
}

.marketIndexItem.sticky .marketIndexItem--Price {
    background: var(--accent);
}

.market--titleBar {
    background: var(--accent-dark2);
    border-bottom: 1px solid var(--accent-dark);
}

.restorePercents.green,
.marketItemPrice {
    color: var(--accent);
}

}

